import React from "react";
import styled from "styled-components";

const Main = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
`;
const Div = styled.div``;
const Login = () => {
  return (
    <Main>
      <Div>
        <input type="email" placeholder="email" />
      </Div>
    </Main>
  );
};

export default Login;
